		<script>
			/**
			 * @param {string} ransomNote
			 * @param {string} magazine
			 * @return {boolean}
			 * 哈希表 时间复杂度O(m+n) 空间复杂度O(m+n)
			 */
			var canConstruct = function (ransomNote, magazine) {
				if (ransomNote.length > magazine.length) {
					return false;
				}
				let ranMap = new Map();
				let magMap = new Map();
				for (let char of ransomNote) {
					if (ranMap.has(char)) {
						ranMap.set(char, ranMap.get(char) + 1);
						continue;
					}
					ranMap.set(char, 1);
				}
				for (let char of magazine) {
					if (magMap.has(char)) {
						magMap.set(char, magMap.get(char) + 1);
						continue;
					}
					magMap.set(char, 1);
				}
				for (let key of ranMap.keys()) {
					if (!magMap.has(key) || magMap.get(key) < ranMap.get(key)) {
						return false;
					}
				}
				return true;
			};
